$(function(){var n=new KMaps.Game([new KMaps.Person("Eugene"),new KMaps.Person("Paulina")]),t;$("#game table").find("td").click(function(t){var i,r,u;$("#turn").text(n.CurrentTurn()),i=$(t.target),i.text()==""&&(r=i.data("x")-1,u=i.parent().data("y")-1,i.text(n.Turn),n.MakeMove(new KMaps.Cell(r,u)))}),t=function(n){return $("#game table").find("td").eq(n)},$("#randomMoves").click(function(){for(var r,i=0;i<33;i++)r=t(i),r.text(n.Turn),n.MakeMove(new KMaps.Cell(r.data("x")-1,r.parent().data("y")-1))}),$("#clearBoard").click(function(){n.Reset();for(var i=0;i<33;i++)t(i).text("")})})